const TableTemplate = () => {


  return (
        <div className="container" style={{ width: "600px" }}>
          <div className="my-3">
            <form>
              <div className="form-group row">
                <label>Email address</label>
                <input className="form-control"/>
              </div>
            </form>
          </div>
        </div>
  );
};

export default TableTemplate;
